// import Home from '../page/admin/Admin'
// import Login from '../page/login/Login'
import {lazy} from 'react'

let router = [
    {
        path: '/',
        name: '首页',
        components: lazy(()=> import('../page/admin/Admin')),
        exact: true,
        // children: [
        //     {
        //         path: '/login',
        //         name: '登录',
        //         components: Login
        //     }
        // ]

    },
    {
        path: '/login',
        name: '登录',
        components: lazy(()=>import('../page/login/Login'))
    }
];

export default router;
